import { Navbar, Nav, NavDropdown, Dropdown, ButtonGroup } from 'react-bootstrap';
import AdminStyleSheet from '../style-sheets/adminStyleSheet';
import { DropdownButton } from 'react-bootstrap';


const AdminToolbar = () => (
  <div>
    <Navbar collapseOnSelect expand="lg" style={AdminStyleSheet.background} variant="dark">
      <Navbar.Brand href="/" className="mr-auto">Muhalik</Navbar.Brand>
      <Navbar.Brand href="#home" className="mr-auto">Admin Dashboard</Navbar.Brand>
      <Dropdown as={ButtonGroup}>
  <Button variant="success">Split Button</Button>

  <Dropdown.Toggle split variant="success" id="dropdown-split-basic" />

  <Dropdown.Menu>
    <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
    <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
    <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
  </Dropdown.Menu>
</Dropdown>
    </Navbar>
    <style jsx>
      {`
        .hover:hover {
          margin-left: 10px;
          margin-right: -10px;
          margin-bottom: 5px;
          margin-top: -5px;
          background: red;
        }        
        .spliter_hover:hover {
          margin-left: 10px;
          margin-right: -10px;
          margin-bottom: 13px;
          margin-top: -5px;
          background: red;
        }
        .dropdown {
          z-index: 200;
        }
        .nav {
          color: white;
        }
     `}
    </style>
  </div>
);

export default AdminToolbar;

